import React, {useEffect,useState} from 'react';
import classes from '../../CSS/Rankings.module.css';


const Rankings=()=>{
    let playerdata = null;
    const[LoadTemp,setLoadTemp]=useState({opacity:0,trans:1})
    useEffect(()=>{
        setTimeout(()=>{
            setLoadTemp({opacity:1,})
        },500)
        setTimeout(()=>{
            setLoadTemp({trans:"none"})
        },1000)
    },[])
    
    return(
        <div className={classes.rankings} style={{opacity:`${LoadTemp.opacity}`, transition:`${trans}s`}}>
            <div className={classes.board}>
                <ul className={classes.boardsep}>
                    <li className={classes.leftsep}></li>
                    <li className={classes.rightsep}></li>
                </ul>
                <ul className={classes.headings}>
                    <li>RANK</li>
                    <li>NAME</li>
                    <li>POINTS</li>
                </ul>
                {playerdata}
           </div>
        </div>
    )
}
export default Rankings
